import React from 'react';
import Header from './Header';
import Main from './Main';
import Date from './Date';
import Footer from './Footer';

class App extends React.Component {
  render() {
    return (
      <div>
        <Header />
        <Date/>
        %<Main />
        <Footer/>
      </div>
    );
  }
}

export default App;
